Content:
Donna Hartley-Redfearn’s intuitive creative flair and strong project management experience means wedding planning comes naturally. Her ability to stay calm under pressure minimises the stress of those around her – and her fun sense of humour is completely infectious!

&nbsp;

She loves a challenge and thrives on designing and delivering stunning weddings that go above and beyond all expectations. Donna is never afraid to roll up her sleeves and believes in a ‘hands on’ approach to life. Both her organisational skills and ability to manage multiple teams ensures nothing is left to chance – not a single detail is overlooked. She loves to see how weddings bring people together and the fun had by all once the couple let their hair down and the party begins!

&nbsp;

Experience counts for everything and after twenty plus years in the industry Donna is proud to be one of the UK's leading industry mentors and wedding industry role models. Donna constantly strives to raise awareness of what professional wedding management is, her work has been featured by the BBC, Channel 4, and multi media houses.

Donna  collaborates with professional partners for both client weddings and commissioned media work. Her work on the Royal Wedding of Prince William and Kate featured on both TV and international blogs. It goes without saying that some of her clients prefer to remain nameless, but there is always demand for NEWP planned and styled weddings to be featured in bridal magazines.

&nbsp;

Donna finds inspiration from the arts, fashion and from her travels, she has a passion for architecture around the world with Milan being her go to city. When not planning weddings, you will find her in hunter wellies in a field of horses or sharing a bottle of wine with friends while enjoying live music.

With many years of experience behind us, we here at Delighted to Invite, are pleased to be able to offer you invitations for every occasion including, Weddings, Bar / Bat Mitzvahs, Birthdays and Anniversaries.

&nbsp;

We specialise in a full personalised, bespoke service in the comfort of your own home where we can work from clients own concepts and ideas. You may choose from one of our many designs or we can work with you to create your unique personalised product, at no extra charge.
